import React from 'react';
import { Button, Grid, Toolbar, Divider } from '@material-ui/core';
import {withStyles,} from '@material-ui/core/styles';
import InstagramIcon from '@material-ui/icons/Instagram';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import IconButton from '@material-ui/core/IconButton';
import FacebookIcon from '@material-ui/icons/Facebook';
import { useHistory } from "react-router-dom";
import './Header.css';

const ColorButton = withStyles((theme) => ({
  root: {
    color: "white",
    background: "black",
    '&:hover': {
      backgroundColor: "black",
    },
    margin: "10px",
    borderRadius: "15px",
  },
}))(Button);

export default function Header() {
  const history = useHistory();


  function goHome() {
    history.push("/"); 
  }

  function goInfo() {
    history.push("/info")
  }

  function goAbout() {
    history.push("/about");
  }

  return (
    <Grid container alignItems="center" justify="center" alignContent="center" style={{borderBottom: "1px solid #367460"}}>
      <Grid item xs={4} sm={4} >
        <div style={{textAlign: "left", display: "flex", alignItems: "center", margin: "10px"}}></div>

      </Grid>
      <Grid item xs={7} sm={8}  >
        <h1>Match Law Student</h1>
      </Grid>
    </Grid>

  );
}
